import React, { useState } from "react";
import AboutMe from "./components/AboutMe";
import Writing from "./components/Writing";
import Resume from "./components/Resume";
import "./App.css";

function App() {
	const [currentPage, setCurrentPage] = useState("home");

	const navigate = (page) => {
		setCurrentPage(page);
	};

	const appStyle = {
		backgroundColor: "#grey",
		color: "white",
	};

	return (
		<div style={appStyle}>
			<nav>
				<div class="title">
					<a onClick={() => navigate("home")}>Naail Lakhani</a>
				</div>
				<div class="navbar-items">
					<a onClick={() => navigate("writing")}>Writing</a>
					<a onClick={() => navigate("resume")}>Work</a>
				</div>
			</nav>
			<main>
				{currentPage === "home" && <AboutMe />}
				{currentPage === "writing" && <Writing />}
				{currentPage === "resume" && <Resume />}
			</main>
		</div>
	);
}

export default App;
